import "./App.css";

function App() {
  return (
    <div className="App">
      <div>
        <div className="heading">RAILWAY SCHEDULER</div>
        <div className="content">
          <div style={{ display: "inline", flexDirection: "column" }}>
            <h1>Train Name</h1>
          </div>
          <div style={{ display: "inline", flexDirection: "column" }}>
            <h1>SC/AC</h1>
          </div>
          <div style={{ display: "inline", flexDirection: "column" }}>
            <h1>50 seats</h1>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
